import React from 'react';
import sketingImg from '../sketing.jpg';
import paintingImg from '../sketching.jpg';
import travelingImg from '../traveling.jpg';

function Hobbies() {
  return (
    <section className="hobbies-collage">
      <div className="hobbies-grid">
        <div className="hobby-item hobby-large">
          <img src={sketingImg} alt="" style={{ width: '20px', height: '400px', objectFit: 'cover' }} />
        </div>
        <div className="hobby-item hobby-tall">
          <img src={paintingImg} alt="" style={{ width: '200px', height: '200px', objectFit: 'cover' }} />
        </div>
        <div className="hobby-item hobby-wide">
          <img src={travelingImg} alt="" style={{ width: '400px', height: '200px', objectFit: 'cover' }} />
        </div>
      </div>
    </section>
  );
}

export default Hobbies;
